import React from 'react';

export default class GetSheduleNew extends Component {
    constructor(props) {
        super(props);
        this.state = {
            error: null,
            isLoaded: false,
            items: []
        };
    }

    componentDidMount() {
        fetch("https://mypew.ru/php/table.php")
        .then(res => res.json())
        .then(
            (result) => {
                const test = result;
            })
    }
    

  render () {
    <div>
        {test}
    </div>
  }
}
